B.HZ=new A.kU("Highrise Havoc","This is a 3D game made using the Unity game engine and C#. This project was made for the Computer Science majors Capstone class. Students form groups and code a project of their choosing. \n\nAs a group of 5, including myself, we decided to make a tower defense game in Unity. In the game, you play as a girl who can shoot robots, and place structures down to fortify your defense. The robots will come in waves and you have to protect the robots from attacking the generators.\n\nTech:\n  \u2022 Unity game engine\n  \u2022 C#\n  \u2022 Blender\n  \u2022 sqlite\n  \u2022 Github\n\nMy contributions:\n  \u2022 Coded the Planning Phase\n    \u2022 Player can buy and place structures down on the map.\n    \u2022 Structure Upgrade System: They can also select a placed structure and upgrade them.\n  \u2022 Drawn 2D art for the game\n  \u2022 Colored the texture for the female player\n  \u2022 Created 3D models: buildings and structures\n            ","Feb 2024 - May 2024",!0,"images/highrise_havoc_screenshot.png","https://greedyskunk.itch.io/capstone-3d-game",null)
B.I_=new A.kU("VR FPS - Survive the Night","This is also a 3D game made using the Unity game engine and C#. This project was made for the VR/AR/XR class. The goal was to make an first-person shooter game that can be played in a VR headset. The project is a collection of each student's game. Each student created their own branch on Github which has their own game. My game is called Survive the Night.\n\nSurvive the Night is a first-person shooter where you can pick up a shotgun and shoot wolves in the forest. It is nighttime and you have to survive until morning to win. Your friend Bobby is also there to help you collect resources and survive.\n\n  Tech:\n    \u2022 Oculus app\n    \u2022 Unity game engine\n    \u2022 Blender\n    \u2022 C#\n    \u2022 Oculus Quest 2\n    \u2022 Github\n                \n  My contributions:\n    \u2022 Shotgun\n      \u2022 Manually use the shotgun to shoot\n    \u2022 Bobby AI\n      \u2022 Used finite state machines to code Bobby's behaviors\n      \u2022 Used Unity's AI navigation\n    \u2022 In-game time\n    \u2022 Wolves/Husky AI\n      \u2022 Use finite state machines to code the enemy's behaviors\n      \u2022 Used Unity's AI navigation\n    \u2022 Shotgun ammo, Shotgun ammo boxes, backpack, stick, phone, and flashlight\n    \u2022 3D modeled in Blender: shotgun, shotgun ammo, shotgun box, stick, backpack, and flashlight\n            ","Feb 2024 - May 2024",!1,"images/vr_fps_shotgun_screenshot.png","https://github.com/CYC02/VR-FPS",null)
B.HX=new A.kU("CVS Health - Aetna - Software Engineer Intern","Collaborated and utilized Agile methodology with other interns to build a Rule Engine under the guidance of the Machine Learning team.\nMy contributions:\n  \u2022 Utilized Python, Github, and Visual Studio to develop a Rule Engine that analyzed and filtered over 10,000 different anomaly metrics to assign the severity level which determined the priority of each anomaly.\n  \u2022 Implemented Agile methodology by incorporating sprint planning, daily stand-ups, and daily meetings with subject matter experts into our development process. This allowed for continuous improvements and transparency in work progress.\n  \u2022 Showcased knowledge gained and accomplishments by providing a presentation and live demo of the Rule Engine to an audience of over 40 people including executive-level colleagues.\n            ","Jan 2022 - Jan 2022",!0,"","",null)
B.HW=new A.kU("A Lockdown Story","I joined a college event during the Winter break and created a point-and-click game about COVID-19 with a group. The game was created to be informative and interesting. There is a quiz on Covid-19 information and resource-management gameplay.\nMy contributions:\n  \u2022 Worked in a group to create a game using Unity and a website hosted with GitHub Pages\n  \u2022 Created sprites/art for the game\n  \u2022 Coded animations in the game\n  \u2022 Updated progress of development on the website\n  \u2022 Pitched the product to Google engineers\n            ","Dec 2020 - Jan 2021",!1,"images/lockdown_story_screenshot.png","https://cyc02.github.io/winter-2021-codefest-submissions-certified-couch-potatoes/",null)
